        channel_bot_user_id?: optionValueInteger;

        /** Identifier of the enabled proxy */
        enabled_proxy_id?: optionValueInteger;

        /** If true, access to Telegram is likely blocked for the user */
        expect_blocking?: optionValueBoolean;

